import React from 'react';
import Item from '../Item/Item';

const ItemList = ({ toDoItem }) => (
  <ul>
    <li> <Item toDoItem={toDoItem} /></li>
    <li> <Item toDoItem={toDoItem} /></li>
    <li> <Item toDoItem={toDoItem} /></li>
  </ul> 
);

export default ItemList;
